#
# TABLE STRUCTURE FOR: brands
#

DROP TABLE IF EXISTS `brands`;

CREATE TABLE `brands` (
  `brands_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название бренда',
  `country` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Страна бренда',
  PRIMARY KEY (`brands_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Бренды товаров';






# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `profiles_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ФИО пользователя',
  `gender` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Пол',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Email пользователя',
  `phone` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Телефон пользователя',
  `birthday` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Дата рождения',
  `adress` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Адрес пользователя',
  `discount` float unsigned DEFAULT NULL COMMENT 'Величина скидки',
  `redemption` float unsigned DEFAULT NULL COMMENT 'Процент выкупа',
  `profiles_Like_brands` int(10) unsigned NOT NULL COMMENT 'Любимые бренды пользователя',
  PRIMARY KEY (`profiles_id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Профиль пользователя';


#
# TABLE STRUCTURE FOR: products
#

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `product_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `product_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название товара',
  `desription` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Описание товара',
  `remains` int(10) unsigned DEFAULT NULL COMMENT 'Запас товарной позиции на складе',
  `price` int(10) unsigned DEFAULT NULL COMMENT 'Цена товара',
  `estimation_id` int(10) unsigned DEFAULT NULL COMMENT 'Средняя оценка товара',
  `stocks_id` int(10) unsigned DEFAULT NULL COMMENT 'Действующая акция',
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Товары бренда';



#
# TABLE STRUCTURE FOR: stocks
#

DROP TABLE IF EXISTS `stocks`;

CREATE TABLE `stocks` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `stocks_name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название акции',
  `stocks_description` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание акции',
  `start_date` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Дата начала акции',
  `end_date` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Дата окончания акции',
  `activation` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Статус активации',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Акции';


#
# TABLE STRUCTURE FOR: purchase
#

DROP TABLE IF EXISTS `purchase`;

CREATE TABLE `purchase` (
  `profiles_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на покупателя',
  `product_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на товар',
  `date_of_purchase` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Дата покупки',
  `type_of_purchase` enum('pick_up_services','delivery') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Тип доставки',
  PRIMARY KEY (`profiles_id`,`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='История покупок';


#
# TABLE STRUCTURE FOR: delivery
#

DROP TABLE IF EXISTS `delivery`;

CREATE TABLE `delivery` (
  `delivery_date` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Дата доставки',
  `order_number` int(10) unsigned NOT NULL COMMENT 'Номер заказа',
  `delivery_address` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Адрес доставки',
  `order_amount` int(10) unsigned NOT NULL COMMENT 'Сумма заказа',
  `id` int(10) unsigned NOT NULL COMMENT 'Идентификатор строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Курьерские доставки';

#
# TABLE STRUCTURE FOR: feedback
#

DROP TABLE IF EXISTS `feedback`;

CREATE TABLE `feedback` (
  `feedback_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Номер обращения',
  `profiles_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на автора обращения',
  `sections` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Разделы техподдержки',
  `date_of_creation` datetime DEFAULT current_timestamp() COMMENT 'Дата создания',
  `body` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Текст обращения',
  `answer` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Ответ техподдержки',
  PRIMARY KEY (`feedback_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Обратная связь';



#
# TABLE STRUCTURE FOR: type_of_purchase
#

DROP TABLE IF EXISTS `type_of_purchase`;

CREATE TABLE `type_of_purchase` (
  `purchase_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `purchase_name` enum('pick_up_services','delivery') COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`purchase_id`),
  UNIQUE KEY `unic_type_of_purchase` (`purchase_name`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Типы покупок';







